        var urlRegex = /(\b(https?|ftp|file):\/\/[-A-Z0-9+&@#\/%?=~_|!:,.;]*[-A-Z0-9+&@#\/%=~_|])/ig;
        return tmp.replace(urlRegex, function (url) {
            return '<a href="' + url + '" target="_blank" + style="word-break:break-all">' + url + '</a>';

        })
    }
